In TypeScript, you can use the `as` keyword to assert that a value has a certain type, even if the type system cannot prove it at compile-time. This is known as a type assertion.

Here's an example:
```
let value = "hello";

// TypeScript will complain because it doesn't know the type of value
// console.log(value.toUpperCase());

// Use a type assertion to tell TypeScript that value is of type string
console.log(value.toUpperCase() as string);
```
In this example, the type system does not know the type of the `value` variable, so it complains when you try to call the `toUpperCase()` method on it. By using a type assertion, you're telling TypeScript that the value is of type `string`, so the call to `toUpperCase()` is valid.

It's important to note that type assertions are not always necessary, and should only be used when you know that the value will always have a certain type, even if TypeScript cannot prove it. Overusing type assertions can make your code less type-safe, so use them with caution.

